image inanna
relocatable true
set image.bits=64
set image.arch=1
cconv illegal_call
syscall amd64_unix_syscall
entrypoint inannaentrypoint
asm amd64
pass threetotwo
pass conditionalbranchsplitter
pass branchremover
pass addressof
pass constmover
pass cmpmover
pass sillyregalloc
pass resolveconstaddr
pass stacksize
pass bitsize
name inanna_amd64
path ../
constant READ_PERMISSION 1
constant RW_PERMISSION 2
constant EXECUTE_PERMISSION 3
